var strFolders = "";
var marrFolders = undefined;
var marrFiles = {};
var marrXmlResult = new Array();
var marrRequest =[];
//Get the environment variables we need.
var ipaddr  = process.env.OPENSHIFT_NODEJS_IP || "127.0.0.1";
var port    = process.env.OPENSHIFT_NODEJS_PORT || 8080;

var getXml = function(strFolder){
	//var xmlResult = '<?xml version="1.0" encoding="UTF-8" ?><audio-list>';
	var arrFiles = marrFiles[strFolder];
	if(arrFiles == undefined) return ""; 
	var xmlResult = '<audio-list>';
	console.log("Length = " + arrFiles.length);
	for(var i=0; i<arrFiles.length; i++ ){
		xmlResult += " <audio-info>";
		xmlResult += " <title>" + arrFiles[i].title + "</title>";
		xmlResult += " <url>" +  arrFiles[i].url + "</url>";
		xmlResult += " <size>" + arrFiles[i].size + "</size>";
		xmlResult += " </audio-info>";
		console.log(arrFiles[i].title + " " + arrFiles[i].url + "[" + arrFiles[i].size + "]\n\r");
	}	
	return xmlResult + " </audio-list>\n\r";
}

var prepareServer = function(){
	//strFolders = "";
	for(var i=0; i< masterData.length; i++ ){
		
		masterData[i].movie =  masterData[i].movie.replace(/\s/g , "-");
		//console.log(" - " + masterData[i].movie );  
		
		if(i==0){
			strFolders = masterData[i].movie;
		}else{
			strFolders +=   "," + masterData[i].movie  ; 
		}
		marrFiles[masterData[i].movie] = masterData[i].songs;
				
	}
	marrFolders = strFolders.split(",");
	console.log("Total No Moveis :" + marrFolders.length);
	marrFolders.sort();
	for(var i=0; i< marrFolders.length; i++ ){
		console.log(" - " + marrFolders[i] );  
			if(i==0){
				strFolders = marrFolders[i];
			}else{
				strFolders +=   "," + marrFolders[i];
			}
	}
	
}
prepareServer();

function capitalize(s){
    return s.toLowerCase().replace( /\b./g, function(a){ return a.toUpperCase(); } );
};

function dhm(t){
    var cd = 24 * 60 * 60 * 1000,
        ch = 60 * 60 * 1000,
        d = Math.floor(t / cd),
        h = '0' + Math.floor( (t - d * cd) / ch),
        m = '0' + Math.round( (t - d * cd - h * ch) / 60000);
    return [d, h.substr(-2), m.substr(-2)].join(':');
}

function getDDMMYYHHMMSS(t){
	return  t.getDate() + "/"
			+ (t.getMonth()+1)  + "/" 
			+ t.getFullYear() + " @ "  
			+ t.getHours() + ":"  
			+ t.getMinutes() + ":" 
			+ t.getSeconds();	
}
																

var timeServerStart = new Date();
http.createServer(function(req,res){
	//console.log("url : " + req.url);
	//req.on('end', function () { } );
		
		console.log("req.on : " + req.url);
		if (req.url === '/favicon.ico') {
			res.writeHead(200, {'Content-Type': 'image/x-icon'} );
			res.end();
			console.log('favicon requested');
			return;
		}
		
		var _get = url.parse(req.url, true).query;
		
		
		if(_get ){
			res.writeHead(200,{"Content-type":"text/html"});	
		
			var service =  (_get.service != undefined) ? _get.service : 'GET_AUDIO_XML';		
			
			switch(service){
				
				case 'GET_AUDIO_XML':	{	
				    //console.log("folder = " + _get.folder );
					var folderName = _get.folder;
					if(folderName ){
						if(  marrXmlResult[folderName] == undefined ){
							marrXmlResult[folderName]  = getXml(folderName);
						}					
						res.write(marrXmlResult[folderName]);
						if(marrRequest[folderName] == undefined){
							marrRequest[folderName] = 1;
						}else{
							marrRequest[folderName] += 1;
						}
					}
				}break;
				
				case 'GET_AUDIO_JSON':	{
					res.write( JSON.stringify(marrFiles ) );
				}break;
				
				case 'VIEW_SERVER':	{
					
					var now = new Date();											
					res.write( getDDMMYYHHMMSS(timeServerStart) + " [" + dhm(now.getTime() - timeServerStart.getTime()) + "]<br>"  );
										 
					for( movieName in marrRequest){
				     res.write( movieName + " : " + marrRequest[movieName] + "<br>"  );
					}
				}break;
				
				case 'GET_FOLDERS':	{
					res.write(strFolders);
				}break;
				
			}
			res.end();	
			return;
		}
							
}).listen(port, ipaddr);